// Initialize the Q-function as an empty JavaScript object
let qFunction = {};

// Function to update the Q-function based on a state, action, and reward
function updateQFunction(state, action, reward, nextState) {
  // Check if the state has been visited before
  if (!qFunction[state]) {
    qFunction[state] = {};
  }

  // Calculate the Q-value for the state-action pair
  let currentQValue = qFunction[state][action] || 0;
  let nextStateValue = Math.max(...Object.values(qFunction[nextState] || {}));
  let updatedQValue = reward + nextStateValue;

  // Update the Q-function with the new Q-value
  qFunction[state][action] = updatedQValue;
}

// Function to select the best action based on the Q-function
function selectAction(state) {
  let actionValues = qFunction[state] || {};
  let bestAction = Object.keys(actionValues).reduce((a, b) => {
    return actionValues[a] > actionValues[b] ? a : b;
  });
  return bestAction;
}

